import logo from './logo.svg';
import './App.css';
import Button from '@mui/material/Button';
import TribeMembersTable from "./TribeMembersTable"
import { useEffect, useState } from 'react';
import { Box, Typography, Container, Divider} from '@mui/material';
import { grey, indigo } from '@mui/material/colors';
import TribeInfoBanner from './TribeInfoBanner';
import TribePayoutBanner from './TribePayoutBanner';
import colors from "./colors";
import TribeMembersPayoutTable from './TribeMembersPayoutTable';


const URL = "https://pawpawtree.wisetribe.digital"
const DEV_MODE = false
const rawToPaw = (raw) => {
  if (raw.length < 28) {
      return "0"
  }
  return raw.substring(0, raw.length-27)
}

const tribeMembersToRows = (tribeMembers) => {
  let rows = []
  let i = 0
  for (const [address, info] of Object.entries(tribeMembers)) {
      rows.push({
          id: i,
          address: address,
          starting_balance: info.starting_balance,
          current_balance: rawToPaw(info.current_balance),
          average_balance: info.average_balance,
          average_perc: info.average_perc,
          average_payout: info.average_payout,
          tribe_tenure: ~~info.tribe_tenure,
      })
      i++
  }

  return rows
}

const tribePayoutMembersToRows = (tribeMembers) => {
  let rows = []
  let i = 0
  for (const [address, info] of Object.entries(tribeMembers)) {
      rows.push({
          id: i,
          address: address,
          payment_block: info.payment_block,
          error: info.error,
          starting_balance: info.starting_balance,
          current_balance: rawToPaw(info.current_balance),
          average_balance: info.average_balance,
          average_perc: info.average_perc,
          average_payout: info.average_payout,
          tribe_tenure: ~~info.tribe_tenure,
      })
      i++
  }

  return rows
}


const getTribeInfoVersion = async(tribeAddress, version) => {
  if (DEV_MODE === true) {
    return testData
  }
  const endpoint = URL + "/api/tribe-info/" + tribeAddress + "/" + version.toString()
  const result = await fetch(endpoint, {
    method: "GET",
    mode: 'no-cors', // no-cors, *cors, same-origin
  })
  // console.log("tribe info results: ", await result.text())
  const response =  await result.json()
  return response
}

const getTribePaymentInfoVersion = async(tribeAddress, version) => {
  if (DEV_MODE === true) {
    return testData
  }
  const endpoint = URL + "/api/tribe-payment/" + tribeAddress + "/" + version.toString()
  const result = await fetch(endpoint, {
    method: "GET",
    mode: 'no-cors', // no-cors, *cors, same-origin
  })
  // console.log("tribe info results: ", await result.text())
  const response =  await result.json()
  return response
}

const getTribeInfo = async(tribeAddress) => {
  const today = await getTribeInfoVersion(tribeAddress, "latest")
  const yesterday = (today.tribe.tribe_info_1_day_ago_version === null) ? null : await getTribeInfoVersion(tribeAddress, today.tribe.tribe_info_1_day_ago_version)
  const weekAgo = (today.tribe.tribe_info_7_day_ago_version === null) ? null : await getTribeInfoVersion(tribeAddress, today.tribe.tribe_info_7_day_ago_version)

  return {
    today: today,
    yesterday: yesterday,
    weekAgo: weekAgo
  }
}

const getTribePaymentInfo = async(tribeAddress) => {
  const result = await getTribePaymentInfoVersion(tribeAddress, "latest")
  return result
}

const getTribeAddress = () => {
  const parts = window.location.href.split("/")
  const tribeAddress = parts[parts.length-1]
  if (tribeAddress.startsWith("paw_")) {
    return tribeAddress
  }
  return "paw_11sao8crjdd91iifeipkri5xaes98mgqh9zwcaxup8g9gw3o1p9cknqgy6xj"
}

const App = () => {
  const tribeAddress = getTribeAddress()
  const [rows, setRows] = useState([])
  const [tribeInfo, setTribeInfo] = useState(null)
  const [yesterdayTribeInfo, setYesterdayTribeInfo] = useState(null)
  const [weekAgoTribeInfo, setWeekAgoTribeInfo] = useState(null)
  const [payoutRows, setPayoutRows] = useState([])
  const [payoutInfo, setPayoutInfo] = useState(null)


  useEffect(() => {
    getTribeInfo(tribeAddress).then(results => {
      setTribeInfo(results.today)
      console.log(results)
      setRows(tribeMembersToRows(results.today.tribe_members))
      setYesterdayTribeInfo(results.yesterday)
      setWeekAgoTribeInfo(results.weekAgo)
    })

    getTribePaymentInfo(tribeAddress).then(results => {
      console.log("Tribe Payment Info")
      console.log(results)
      setPayoutInfo(results)
      setPayoutRows(tribePayoutMembersToRows(results.tribe_members))
    })
  }, [getTribeInfo])

  return (
    <Container disableGutters maxWidth={false} sx={{
      backgroundColor: "#181b1a",
      color: colors.GREY_LIGHT_FONT
    }}>
      <TribeInfoBanner tribeInfo={tribeInfo} yesterdayTribeInfo={yesterdayTribeInfo} weekAgoTribeInfo={weekAgoTribeInfo}/>
      <TribeMembersTable rows={rows}/>
      <Divider/>
      <TribePayoutBanner tribeInfo={payoutInfo} />
      <TribeMembersPayoutTable rows={payoutRows}/>
    </Container>
  );
}

export default App;


